import React, { ReactNode } from 'react';
import Head from 'next/head';
import {
  Header,
  Navbar,
  Container,
  NavbarBrand,
  NavbarLogo,
  TogglerButton,
} from './Styles';

type Props = {
  children?: ReactNode;
  title?: string;
};

const Layout: React.FC<Props> = ({ children, title }) => (
  <React.Fragment>
    <Head>
      <title>{title}</title>
    </Head>
    <Header>
      <Container className="container">
        <Navbar className="navbar navbar-expand-md shadow">
          <Container>
            <NavbarBrand href="/">
              <NavbarLogo src="/img/araka/logo_symbol.png" /> Araka
            </NavbarBrand>
            <TogglerButton
              className="navbar-toggler"
              type="button"
              data-toggle="collapse"
              data-target="#navbarResponsive"
            ></TogglerButton>
          </Container>
        </Navbar>
      </Container>
    </Header>
    {/* {children} */}
  </React.Fragment>
);

export default Layout;
